selector_to_html = {"a[href=\"user_guide/registration.html#inputs\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.2. </span>Inputs<a class=\"headerlink\" href=\"#inputs\" title=\"Permalink to this heading\">#</a></h2><p>In addition to the default function inputs described in section <a class=\"reference internal\" href=\"first_steps/overview.html#parameters\"><span class=\"std std-ref\">Core Parameters</span></a>, registration has a few important additional parameters.</p><p><code class=\"code docutils literal notranslate\"><span class=\"pre\">start_plane</span></code>\n: The plane to start registration.</p>", "a[href=\"user_guide/segmentation.html#segmentation-overview\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3.1. </span>Segmentation Overview<a class=\"headerlink\" href=\"#segmentation-overview\" title=\"Permalink to this heading\">#</a></h2><p>Much of work is about separating \u201cgood activity\u201d, the flourescence changes that we can attribute to a single cell, vs \u201cnoise, which is everything else (including signal from other neurons).</p><p>To do this, we take advantage of the fact that a <em>slow calcium signal is typically similar between adjacent frames</em>.</p>", "a[href=\"user_guide/assembly.html#inputs\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.2. </span>Inputs<a class=\"headerlink\" href=\"#inputs\" title=\"Permalink to this heading\">#</a></h2><p>This example follows a directory structure shown in <a class=\"reference internal\" href=\"first_steps/setup.html#directory-structure\"><span class=\"std std-ref\">the first steps guide</span></a>.</p><p>Inputs and outputs can be anywhere you wish so long as you have read/write permissions.</p>", "a[href=\"user_guide/tips_tricks.html#learn-about-functions\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">5.3. </span>Learn about Functions<a class=\"headerlink\" href=\"#learn-about-functions\" title=\"Permalink to this heading\">#</a></h2>", "a[href=\"tutorials/segmentation_tutorial.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2. </span>Explained: Source Extraction<a class=\"headerlink\" href=\"#explained-source-extraction\" title=\"Permalink to this heading\">#</a></h1><p>This section details background information helpful with <a class=\"reference internal\" href=\"user_guide/segmentation.html#ug-source-extraction\"><span class=\"std std-ref\">Step 3: Segmentation</span></a></p><p>Source extraction is the umbrella term for a sequence of steps designed to distinguish neurons from background signal calculate the properties and characteristics of these neurons relative to the background.</p>", "a[href=\"user_guide/collation.html#inputs\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">4.1. </span>Inputs<a class=\"headerlink\" href=\"#inputs\" title=\"Permalink to this heading\">#</a></h2><p>First, the [Y, X] offsets (in microns) are used for an initial, dirty axial alignment:</p>", "a[href=\"image_gallery.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Image Gallery<a class=\"headerlink\" href=\"#image-gallery\" title=\"Permalink to this heading\">#</a></h1><h2>Image Assembly<a class=\"headerlink\" href=\"#image-assembly\" title=\"Permalink to this heading\">#</a></h2><p><a class=\"reference external\" href=\"https://cerodell.github.io/sphinx-quickstart-guide/build/html/addtoindx.html\">Back to Guide</a></p>", "a[href=\"api/internal.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3. </span>Internals<a class=\"headerlink\" href=\"#internals\" title=\"Permalink to this heading\">#</a></h1><p>Functions that are meant for use within the pipeline, not for public use.</p>", "a[href=\"api/core.html#collatePlanes\"]": "<dt class=\"sig sig-object mat\" id=\"collatePlanes\">\n<span class=\"sig-name descname\"><span class=\"pre\">collatePlanes</span></span><span class=\"sig-paren\">(</span><em class=\"sig-param\"><span class=\"pre\">data_path</span></em>, <em class=\"sig-param\"><span class=\"pre\">varargin</span></em><span class=\"sig-paren\">)</span></dt><dd></dd>", "a[href=\"user_guide/tips_tricks.html#parallel-processing\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">5.4. </span>Parallel Processing<a class=\"headerlink\" href=\"#parallel-processing\" title=\"Permalink to this heading\">#</a></h2><p>The MATLAB <a class=\"reference external\" href=\"https://www.mathworks.com/help/parallel-computing/parpool.html\">parpool documentation</a> and imply that parpool uses the <strong>number of physical cores</strong> (rather than logical) by default.\nHowever, there are instances where the parpool shuts down due to requesting \u201ctoo many logical cores\u201d, suggesting the contrary to the documentation.\nYou can avoid many parallel-processing related issues by <strong>reducing the number of workers to the actual number of physical cores</strong>:</p>", "a[href=\"first_steps/index.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">First Steps<a class=\"headerlink\" href=\"#first-steps\" title=\"Permalink to this heading\">#</a></h1><p>This section details all steps that should be performed prior to analyzing your dataset.</p><p>Installation covers how to download and setup this software across various operating systems.</p>", "a[href=\"user_guide/segmentation.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3. </span>Segmentation<a class=\"headerlink\" href=\"#segmentation\" title=\"Permalink to this heading\">#</a></h1><p>Function for this step: <a class=\"reference internal\" href=\"api/core.html#segmentPlane\" title=\"segmentPlane\"><code class=\"xref mat mat-func docutils literal notranslate\"><span class=\"pre\">segmentPlane()</span></code></a></p>", "a[href=\"user_guide/segmentation.html#segmentation-outputs\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3.4. </span>Segmentation Outputs<a class=\"headerlink\" href=\"#segmentation-outputs\" title=\"Permalink to this heading\">#</a></h2><p>The <code class=\"code docutils literal notranslate\"><span class=\"pre\">.h5</span></code> output for segmentation contains several groups.\nYou will not find any movies, those are stored in the <a class=\"reference internal\" href=\"user_guide/registration.html#reg-output\"><span class=\"std std-ref\">registration outputs</span></a>.</p>", "a[href=\"user_guide/tips_tricks.html#fullfile\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">5.2. </span>Fullfile<a class=\"headerlink\" href=\"#fullfile\" title=\"Permalink to this heading\">#</a></h2><p>Matlabs <a class=\"reference external\" href=\"https://www.mathworks.com/help/matlab/ref/fullfile.html\">fullfile</a> function makes it easy to search for a filename:</p>", "a[href=\"tutorials/segmentation_tutorial.html#constrained-non-negative-matrix-factorization-cnmf\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.1. </span>Constrained Non-Negative Matrix Factorization (CNMF)<a class=\"headerlink\" href=\"#constrained-non-negative-matrix-factorization-cnmf\" title=\"Permalink to this heading\">#</a></h2><p>At a high-level, the <a class=\"reference internal\" href=\"glossary.html#term-CNMF\"><span class=\"xref std std-term\">CNMF</span></a> algorithm works by:</p>", "a[href=\"first_steps/setup.html#directory-structure\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Directory Structure<a class=\"headerlink\" href=\"#directory-structure\" title=\"Permalink to this heading\">#</a></h2><p>The following is an example of the directory hierarchy\nused for the demo.</p>", "a[href=\"first_steps/setup.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">0.1. Project Setup<a class=\"headerlink\" href=\"#project-setup\" title=\"Permalink to this heading\">#</a></h1><h2>Installation<a class=\"headerlink\" href=\"#installation\" title=\"Permalink to this heading\">#</a></h2><p>Users with <a class=\"reference external\" href=\"https://git-scm.com/\">git</a> experience are encouraged to skip to the <a class=\"reference internal\" href=\"#installation-git\"><span class=\"std std-ref\">git installation section</span></a>.\nThis option avoids the need repeat the download process each time a new version of the pipeline is produced.</p>", "a[href=\"tutorials/segmentation_tutorial.html#validating-neurons-and-traces\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.3. </span>Validating Neurons and Traces<a class=\"headerlink\" href=\"#validating-neurons-and-traces\" title=\"Permalink to this heading\">#</a></h2><p>The key idea for validating our neurons is that <strong>we know how long the\nbrightness indicating neurons activity should stay bright</strong> as a function\nof the <em>number of frames</em>.</p><p>That is, our calcium indicator (in this example: GCaMP-6s):</p>", "a[href=\"user_guide/registration.html#overview\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.1. </span>Overview<a class=\"headerlink\" href=\"#overview\" title=\"Permalink to this heading\">#</a></h2><p>Disturbances or movement in our timeseries cause variations in pixel locations between frames called <strong>motion artifacts</strong>.</p><p>The motion artifacts present in our sample come in two flavors, <code class=\"docutils literal notranslate\"><span class=\"pre\">rigid</span></code> and <code class=\"docutils literal notranslate\"><span class=\"pre\">non-rigid</span></code>. See <a class=\"reference internal\" href=\"tutorials/registration_tutorial.html#tut-types-of-reg\"><span class=\"std std-ref\">Types of Registration</span></a> for more information.</p>", "a[href=\"api/core.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1. </span>Core<a class=\"headerlink\" href=\"#core\" title=\"Permalink to this heading\">#</a></h1><p>Core functions used to run the pipeline.</p>", "a[href=\"user_guide/assembly.html#overview\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.1. </span>Overview<a class=\"headerlink\" href=\"#overview\" title=\"Permalink to this heading\">#</a></h2><p>Assembling reconstructed images from raw LBM datasets consists of 3 main processing steps:</p>", "a[href=\"user_guide/registration.html#outputs\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.5. </span>Outputs<a class=\"headerlink\" href=\"#outputs\" title=\"Permalink to this heading\">#</a></h2><p>Just like <a class=\"reference internal\" href=\"user_guide/assembly.html#extraction-inputs\"><span class=\"std std-ref\">assembly outputs</span></a>, registration outputs to <code class=\"code docutils literal notranslate\"><span class=\"pre\">.h5</span></code> format.</p><p>Registration outputs have the following groups:</p>", "a[href=\"user_guide/troubleshooting.html#matlab-server-issues\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">6.3. </span>Matlab Server Issues<a class=\"headerlink\" href=\"#matlab-server-issues\" title=\"Permalink to this heading\">#</a></h2><p>These come in many flavors and are mostly <cite>windows</cite> issues due to their background serrvice.</p><p>Here is the general fix for all of them:</p>", "a[href=\"api/core.html#convertScanImageTiffToVolume\"]": "<dt class=\"sig sig-object mat\" id=\"convertScanImageTiffToVolume\">\n<span class=\"sig-name descname\"><span class=\"pre\">convertScanImageTiffToVolume</span></span><span class=\"sig-paren\">(</span><em class=\"sig-param\"><span class=\"pre\">data_path</span></em>, <em class=\"sig-param\"><span class=\"pre\">varargin</span></em><span class=\"sig-paren\">)</span></dt><dd><p>Convert ScanImage .tif files into a 4D volume.</p><p>Convert raw scanimage multi-roi .tif files from a single session\ninto a single 4D volumetric time-series (x, y, z, t). It\u2019s designed to process files for the\nScanImage Version: 2016 software.</p></dd>", "a[href=\"#pipeline-overview\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Pipeline Overview<a class=\"headerlink\" href=\"#pipeline-overview\" title=\"Permalink to this heading\">#</a></h2><p>There are 4 core steps in this pipeline:</p>", "a[href=\"user_guide/assembly.html#outputs\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.3. </span>Outputs<a class=\"headerlink\" href=\"#outputs\" title=\"Permalink to this heading\">#</a></h2><p>Output data are saved in <code class=\"docutils literal notranslate\"><span class=\"pre\">.h5</span></code> format, with the following characteristics:</p>", "a[href=\"api/utility.html#writers\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.2. </span>Writers<a class=\"headerlink\" href=\"#writers\" title=\"Permalink to this heading\">#</a></h2>", "a[href=\"user_guide/collation.html#outputs\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">4.2. </span>Outputs<a class=\"headerlink\" href=\"#outputs\" title=\"Permalink to this heading\">#</a></h2><p>This output file mirrors the registration output but with all z-planes collated into a single dataset.</p>", "a[href=\"api/core.html#segmentPlane\"]": "<dt class=\"sig sig-object mat\" id=\"segmentPlane\">\n<span class=\"sig-name descname\"><span class=\"pre\">segmentPlane</span></span><span class=\"sig-paren\">(</span><em class=\"sig-param\"><span class=\"pre\">data_path</span></em>, <em class=\"sig-param\"><span class=\"pre\">varargin</span></em><span class=\"sig-paren\">)</span></dt><dd><p>Segment imaging data using CaImAn CNMF.</p><p>This function applies the CaImAn algorithm to segment neurons from\nmotion-corrected, pre-processed and ROI re-assembled MAxiMuM data.\nThe processing is conducted for specified planes, and the results\nare saved to disk.</p><p class=\"rubric\">Notes</p><p><code class=\"code docutils literal notranslate\"><span class=\"pre\">T_keep</span></code>\n:  neuronal time series [Km, T]. <code class=\"code docutils literal notranslate\"><span class=\"pre\">single</span></code></p><p><code class=\"code docutils literal notranslate\"><span class=\"pre\">Ac_keep</span></code>\n:  neuronal footprints [2*tau+1, 2*tau+1, Km]. <code class=\"code docutils literal notranslate\"><span class=\"pre\">single</span></code></p><p><code class=\"code docutils literal notranslate\"><span class=\"pre\">C_keep</span></code>\n:  denoised time series [Km, T]. <code class=\"code docutils literal notranslate\"><span class=\"pre\">single</span></code></p></dd>", "a[href=\"image_gallery.html#image-assembly\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Image Assembly<a class=\"headerlink\" href=\"#image-assembly\" title=\"Permalink to this heading\">#</a></h2><p><a class=\"reference external\" href=\"https://cerodell.github.io/sphinx-quickstart-guide/build/html/addtoindx.html\">Back to Guide</a></p>", "a[href=\"tutorials/index.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Tutorials<a class=\"headerlink\" href=\"#tutorials\" title=\"Permalink to this heading\">#</a></h1><p>This section coveres theory underlying pipeline processes.</p>", "a[href=\"api/utility.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2. </span>Utility<a class=\"headerlink\" href=\"#utility\" title=\"Permalink to this heading\">#</a></h1><p>Functions used by the pipeline that users can take advantage of to further process LBM datasets.</p>", "a[href=\"tutorials/axial_correction_tutorial.html#background\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3.1. </span>Background<a class=\"headerlink\" href=\"#background\" title=\"Permalink to this heading\">#</a></h2><p>Light beads traveling to our sample need to be temporally distinct relative to our sensor\nso that the aquisition system knows the origin and subsequent depth of each bead.</p><p>The current LBM design incoorperates 2 cavities, hereby named <code class=\"docutils literal notranslate\"><span class=\"pre\">Cavity</span> <span class=\"pre\">A</span></code> and <code class=\"docutils literal notranslate\"><span class=\"pre\">Cavity</span> <span class=\"pre\">B</span></code>.\nThese two cavities are non-overlapping areas where light beads travel. If we plot\na sample pollen grain through each z-depth, we can see these cavities manifest:</p>", "a[href=\"user_guide/registration.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2. </span>Registration<a class=\"headerlink\" href=\"#registration\" title=\"Permalink to this heading\">#</a></h1><p>We use <a class=\"reference external\" href=\"https://en.wikipedia.org/wiki/Image_registration\">image registration</a> to make sure that our neuron in the first frame is in the same spatial location as in frame N throughout the time-series.</p>", "a[href=\"user_guide/assembly.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1. </span>Assembly<a class=\"headerlink\" href=\"#assembly\" title=\"Permalink to this heading\">#</a></h1><p>Function for this step: <a class=\"reference internal\" href=\"api/core.html#convertScanImageTiffToVolume\" title=\"convertScanImageTiffToVolume\"><code class=\"xref mat mat-func docutils literal notranslate\"><span class=\"pre\">convertScanImageTiffToVolume()</span></code></a></p>", "a[href=\"tutorials/registration_tutorial.html#types-of-registration\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.1. </span>Types of Registration<a class=\"headerlink\" href=\"#types-of-registration\" title=\"Permalink to this heading\">#</a></h2><p><a class=\"reference external\" href=\"https://en.wikipedia.org/wiki/Image_registration\">Image registration</a> can often improve the quality of cellular traces obtained during the later segmentation step.</p><p>The motion artifacts present in a 3D timeseries come in two flavors, <code class=\"docutils literal notranslate\"><span class=\"pre\">rigid</span></code> and <code class=\"docutils literal notranslate\"><span class=\"pre\">non-rigid</span></code>.</p>", "a[href=\"#lbm-caiman-matlab-documentation\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">LBM-CaImAn-MATLAB Documentation<a class=\"headerlink\" href=\"#lbm-caiman-matlab-documentation\" title=\"Permalink to this heading\">#</a></h1><p>Currently, inputs to this pipeline are limited to ScanImage <code class=\"code docutils literal notranslate\"><span class=\"pre\">.tiff</span></code> files.</p>", "a[href=\"user_guide/index.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">User Guide<a class=\"headerlink\" href=\"#user-guide\" title=\"Permalink to this heading\">#</a></h1><p>This section covers each step in the pipeline, parameters and metadata in more detail.</p>", "a[href=\"user_guide/registration.html#non-rigid-registration\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.4. </span>Non-rigid Registration<a class=\"headerlink\" href=\"#non-rigid-registration\" title=\"Permalink to this heading\">#</a></h2><p>To perform non-rigid registration, you must specify the size of the patches you want to split the FOV into.</p><p>Typical patch sizes for <span class=\"math notranslate nohighlight\">\\(512x512\\)</span> movies are <span class=\"math notranslate nohighlight\">\\(32x32\\)</span>, which would lead to <span class=\"math notranslate nohighlight\">\\(512/32=16\\)</span> blocks that will be motion-corrected in parallel.</p>", "a[href=\"user_guide/segmentation.html#inputs\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3.2. </span>Inputs<a class=\"headerlink\" href=\"#inputs\" title=\"Permalink to this heading\">#</a></h2><p>Inputs are consistent with <a class=\"reference internal\" href=\"user_guide/registration.html#registration\"><span class=\"std std-ref\">Registration</span></a>, substituting::</p>", "a[href=\"user_guide/segmentation.html#tuning-cnmf\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3.3. </span>Tuning CNMF<a class=\"headerlink\" href=\"#tuning-cnmf\" title=\"Permalink to this heading\">#</a></h2><p>To get an idea of the default parameters (what happens if you use <code class=\"code docutils literal notranslate\"><span class=\"pre\">CNMFSetParams()</span></code> with no arguments),\nyou can run the following code to see the defaults:</p>", "a[href=\"user_guide/collation.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">4. </span>Axial Collation and Correction<a class=\"headerlink\" href=\"#axial-collation-and-correction\" title=\"Permalink to this heading\">#</a></h1><p>Use pollen calibration data to spatially align each z-plane and merge across planes.</p><p>Core function(s): <a class=\"reference internal\" href=\"api/core.html#collatePlanes\" title=\"collatePlanes\"><code class=\"xref mat mat-func docutils literal notranslate\"><span class=\"pre\">collatePlanes()</span></code></a></p>", "a[href=\"user_guide/troubleshooting.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">6. </span>Troubleshooting<a class=\"headerlink\" href=\"#troubleshooting\" title=\"Permalink to this heading\">#</a></h1><h2><span class=\"section-number\">6.1. </span>Memory<a class=\"headerlink\" href=\"#memory\" title=\"Permalink to this heading\">#</a></h2>", "a[href=\"api/utility.html#play_movie\"]": "<dt class=\"sig sig-object mat\" id=\"play_movie\">\n<span class=\"sig-name descname\"><span class=\"pre\">play_movie</span></span><span class=\"sig-paren\">(</span><em class=\"sig-param\"><span class=\"pre\">movie_cell_array</span></em>, <em class=\"sig-param\"><span class=\"pre\">labels_cell_array</span></em>, <em class=\"sig-param\"><span class=\"pre\">min_mov</span></em>, <em class=\"sig-param\"><span class=\"pre\">max_mov</span></em><span class=\"sig-paren\">)</span></dt><dd><p>Play a movie or list of movies with labels, press any key to stop  the movie from playing.</p><p class=\"rubric\">Examples</p><p>play_movie({movie1, movie2}, {\u2018Movie 1\u2019, \u2018Movie 2\u2019}, 0, 255)\nplay_movie(movie, \u2018Sample Movie\u2019)</p></dd>", "a[href=\"api/core.html#motionCorrectPlane\"]": "<dt class=\"sig sig-object mat\" id=\"motionCorrectPlane\">\n<span class=\"sig-name descname\"><span class=\"pre\">motionCorrectPlane</span></span><span class=\"sig-paren\">(</span><em class=\"sig-param\"><span class=\"pre\">data_path</span></em>, <em class=\"sig-param\"><span class=\"pre\">varargin</span></em><span class=\"sig-paren\">)</span></dt><dd><p>Perform motion correction on imaging data.</p><p>Each motion-corrected plane is saved as a .h5 group containing the 2D\nshift vectors in x and y. The raw movie is saved in \u2018/Y\u2019 and the</p><p class=\"rubric\">Notes</p></dd>", "a[href=\"first_steps/overview.html#core-parameters\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Core Parameters<a class=\"headerlink\" href=\"#core-parameters\" title=\"Permalink to this heading\">#</a></h2><p>For the <a class=\"reference internal\" href=\"api/core.html#core-api\"><span class=\"std std-ref\">Core</span></a> functions in this pipeline, the initial parameters are always the same.</p>", "a[href=\"user_guide/tips_tricks.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">5. </span>Tips and Tricks<a class=\"headerlink\" href=\"#tips-and-tricks\" title=\"Permalink to this heading\">#</a></h1><h2><span class=\"section-number\">5.1. </span>Exploring Datasets in MATLAB<a class=\"headerlink\" href=\"#exploring-datasets-in-matlab\" title=\"Permalink to this heading\">#</a></h2><p>There are several helper functions located in <code class=\"docutils literal notranslate\"><span class=\"pre\">core/utils</span></code>.</p>", "a[href=\"first_steps/setup.html#dependencies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Dependencies<a class=\"headerlink\" href=\"#dependencies\" title=\"Permalink to this heading\">#</a></h2><p>Before running your first dataset, you should ensure that all dependencies of the pipeline are satisfied.</p><p>This pipeline requires the parallel pool, statistics and machine learning, and image processing toolboxes.</p>", "a[href=\"user_guide/troubleshooting.html#memory\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">6.1. </span>Memory<a class=\"headerlink\" href=\"#memory\" title=\"Permalink to this heading\">#</a></h2>", "a[href=\"api/utility.html#readers\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.1. </span>Readers<a class=\"headerlink\" href=\"#readers\" title=\"Permalink to this heading\">#</a></h2>", "a[href=\"first_steps/overview.html#logging\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Logging<a class=\"headerlink\" href=\"#logging\" title=\"Permalink to this heading\">#</a></h2><h3>To File<a class=\"headerlink\" href=\"#to-file\" title=\"Permalink to this heading\">#</a></h3><p>A log file will be saved with every processing step.</p><p>This logs the start time and duration of each computation, as well as storing metadata and function parameters.</p>", "a[href=\"#documentation-contents\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Documentation Contents<a class=\"headerlink\" href=\"#documentation-contents\" title=\"Permalink to this heading\">#</a></h2>", "a[href=\"tutorials/registration_tutorial.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1. </span>Explained: Registration<a class=\"headerlink\" href=\"#explained-registration\" title=\"Permalink to this heading\">#</a></h1><h2><span class=\"section-number\">1.1. </span>Types of Registration<a class=\"headerlink\" href=\"#types-of-registration\" title=\"Permalink to this heading\">#</a></h2><p><a class=\"reference external\" href=\"https://en.wikipedia.org/wiki/Image_registration\">Image registration</a> can often improve the quality of cellular traces obtained during the later segmentation step.</p><p>The motion artifacts present in a 3D timeseries come in two flavors, <code class=\"docutils literal notranslate\"><span class=\"pre\">rigid</span></code> and <code class=\"docutils literal notranslate\"><span class=\"pre\">non-rigid</span></code>.</p>", "a[href=\"user_guide/tips_tricks.html#find-matlab-install-location\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">5.5. </span>Find MATLAB Install Location<a class=\"headerlink\" href=\"#find-matlab-install-location\" title=\"Permalink to this heading\">#</a></h2><p>The location of the installation is often in <cite>~/Documents/MATLAB/</cite>.\nIf you put the root directory elsewhere, you will need to navigate to that directory within the matlab GUI.</p><p>Modern versions of MATLAB (2017+) solve most Linux/Windows filesystem conflicts.</p>", "a[href=\"api/utility.html#visualization\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.3. </span>Visualization<a class=\"headerlink\" href=\"#visualization\" title=\"Permalink to this heading\">#</a></h2>", "a[href=\"api/utility.html#validation\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.4. </span>Validation<a class=\"headerlink\" href=\"#validation\" title=\"Permalink to this heading\">#</a></h2>", "a[href=\"glossary.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Glossary<a class=\"headerlink\" href=\"#glossary\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"links.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Links<a class=\"headerlink\" href=\"#links\" title=\"Permalink to this heading\">#</a></h1><p id=\"scanimage\"><a class=\"reference external\" href=\"https://www.mbfbioscience.com/products/scanimage/\">scanimage</a></p>", "a[href=\"user_guide/registration.html#validate-outputs\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.6. </span>Validate Outputs<a class=\"headerlink\" href=\"#validate-outputs\" title=\"Permalink to this heading\">#</a></h2><p>Validation metric figures are placed in your <code class=\"docutils literal notranslate\"><span class=\"pre\">save_path</span></code> as <code class=\"docutils literal notranslate\"><span class=\"pre\">figures/registration_metrics_plane_N</span></code>.</p>", "a[href=\"user_guide/troubleshooting.html#windows-filepaths\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">6.4. </span>Windows Filepaths<a class=\"headerlink\" href=\"#windows-filepaths\" title=\"Permalink to this heading\">#</a></h2><p>Sometimes Windows filepaths, with the backslash, is taken as an escape character rather than a file-path separator:</p>", "a[href=\"user_guide/assembly.html#validate-outputs\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.4. </span>Validate Outputs<a class=\"headerlink\" href=\"#validate-outputs\" title=\"Permalink to this heading\">#</a></h2><p>In your <code class=\"docutils literal notranslate\"><span class=\"pre\">save_path</span></code>, you will see a newly created <code class=\"docutils literal notranslate\"><span class=\"pre\">figures</span></code> folder:</p>", "a[href=\"first_steps/overview.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">0.2. Pipeline Usage<a class=\"headerlink\" href=\"#pipeline-usage\" title=\"Permalink to this heading\">#</a></h1><p>The bare-minimum to use this pipeline involves calling four functions which have sensible default values for LBM recordings.</p><p>The only <em>required</em> inputs to the pipeline are a path where your raw/previously processed data lives.</p>", "a[href=\"user_guide/tips_tricks.html#exploring-datasets-in-matlab\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">5.1. </span>Exploring Datasets in MATLAB<a class=\"headerlink\" href=\"#exploring-datasets-in-matlab\" title=\"Permalink to this heading\">#</a></h2><p>There are several helper functions located in <code class=\"docutils literal notranslate\"><span class=\"pre\">core/utils</span></code>.</p>", "a[href=\"tutorials/axial_correction_tutorial.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3. </span>Explained: Axial Offset Correction<a class=\"headerlink\" href=\"#explained-axial-offset-correction\" title=\"Permalink to this heading\">#</a></h1><h2><span class=\"section-number\">3.1. </span>Background<a class=\"headerlink\" href=\"#background\" title=\"Permalink to this heading\">#</a></h2><p>Light beads traveling to our sample need to be temporally distinct relative to our sensor\nso that the aquisition system knows the origin and subsequent depth of each bead.</p><p>The current LBM design incoorperates 2 cavities, hereby named <code class=\"docutils literal notranslate\"><span class=\"pre\">Cavity</span> <span class=\"pre\">A</span></code> and <code class=\"docutils literal notranslate\"><span class=\"pre\">Cavity</span> <span class=\"pre\">B</span></code>.\nThese two cavities are non-overlapping areas where light beads travel. If we plot\na sample pollen grain through each z-depth, we can see these cavities manifest:</p>", "a[href=\"api/index.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">API<a class=\"headerlink\" href=\"#api\" title=\"Permalink to this heading\">#</a></h1><p>There are two forms of functions to know for this pipeline:</p>", "a[href=\"first_steps/setup.html#installation\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Installation<a class=\"headerlink\" href=\"#installation\" title=\"Permalink to this heading\">#</a></h2><p>Users with <a class=\"reference external\" href=\"https://git-scm.com/\">git</a> experience are encouraged to skip to the <a class=\"reference internal\" href=\"#installation-git\"><span class=\"std std-ref\">git installation section</span></a>.\nThis option avoids the need repeat the download process each time a new version of the pipeline is produced.</p>", "a[href=\"user_guide/troubleshooting.html#missing-compiled-binary-windows\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">6.2. </span>Missing Compiled Binary (Windows)<a class=\"headerlink\" href=\"#missing-compiled-binary-windows\" title=\"Permalink to this heading\">#</a></h2><p><strong>Cause:</strong> Likely caused by missing compiled binary for <cite>graph_conn_comp_mex.mexw64 (win)</cite>/ <cite>graph_conn_comp_mex.mexa64 (unix)</cite></p><p><strong>Solution:</strong>\n1. Compile the binary in MATLAB via the command window:</p>", "a[href=\"tutorials/segmentation_tutorial.html#deconvolution\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.2. </span>Deconvolution<a class=\"headerlink\" href=\"#deconvolution\" title=\"Permalink to this heading\">#</a></h2><p>The CNMF output yields \u201craw\u201d traces, we need to deconvolve these to convert these raw traces to interpritable neuronal traces.</p><p>These raw traces are noisy, jagged, and must be denoised, detrended and deconvolved.</p>", "a[href=\"user_guide/registration.html#rigid-registration\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.3. </span>Rigid Registration<a class=\"headerlink\" href=\"#rigid-registration\" title=\"Permalink to this heading\">#</a></h2><p>Rigid registration is accomplished by giving NoRMCorre <strong>no variable for <code class=\"code docutils literal notranslate\"><span class=\"pre\">grid_size</span></code></strong>,\nso it defaults to the size of your image and thus only processing a single patch encompassing the entire field-of-view.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
